-- A fictional database of game developers, built for an exam in a database course
-- (c) 2024, Bjorn Thor Jonsson, Reykjavik University

-- List of videogames and makers is https://en.wikipedia.org/wiki/List_of_video_game_developers
-- Everything else (including genre) is randomly generated to create an examination database
-- This database should only ever be used for that purpose!

DROP TABLE IF EXISTS Plays;
DROP TABLE IF EXISTS Buys;
DROP TABLE IF EXISTS Person;
DROP TABLE IF EXISTS Game;
DROP TABLE IF EXISTS Developer;
DROP TABLE IF EXISTS Country;

CREATE TABLE Country (
  CID INT PRIMARY KEY,
  name VARCHAR NOT NULL UNIQUE,
  population INT NULL
);

CREATE TABLE Developer (
  DID INT PRIMARY KEY,
  name VARCHAR NOT NULL UNIQUE,
  since INT NULL,
  CID INT NOT NULL REFERENCES Country (CID)
);

CREATE TABLE Game (
  GID INT PRIMARY KEY,
  name VARCHAR NOT NULL UNIQUE,
  genre VARCHAR NOT NULL,
  DID INT NOT NULL REFERENCES Developer (DID)
);

CREATE TABLE Person (
  PID INT PRIMARY KEY,
  name VARCHAR NOT NULL,
  birthyear INT NOT NULL
);

CREATE TABLE Buys (
  GID INT NOT NULL REFERENCES Game (GID),
  PID INT NOT NULL REFERENCES Person (PID),
  year INT NOT NULL,
  PRIMARY KEY (GID, PID)
);

CREATE TABLE Plays (
  GID INT NOT NULL REFERENCES Game (GID),
  PID INT NOT NULL REFERENCES Person (PID),
  PRIMARY KEY (GID, PID)
);

\set CLIENT_ENCODING 'UTF8'
